import { BrowserRouter, Route } from "react-router-dom";
import Equipments from "./Equipments";
import Home from "./Home";
import Paths from "./Paths";

function App() {
  return (
    <BrowserRouter>
      <Route path="/" element={<Home/>}/>
      <Equipments/>
    </BrowserRouter>
  );
}

export default App;
